import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './Kayit.css'; // CSS dosyasını içe aktarıyoruz


const Kayit = ({ onSelectLanguage }) => {
  const [currentLanguage, setCurrentLanguage] = useState('Choose your language');
  const languages = [
    'Choose your language',
    'Выберите ваш язык',
    'Dil Seçiniz',
    'Choisissez votre langue',
    'اختر لغتك'
  ];
  let languageIndex = 0;
  const navigate = useNavigate();

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentLanguage(languages[languageIndex]);
      languageIndex = (languageIndex + 1) % languages.length;
    }, 300);

    return () => clearInterval(interval);
  }, []);

  const handleLanguageSelect = (language) => {
    onSelectLanguage();
    navigate('/main', { state: { language } });
  };

  const styles = {
    container: {
      width: '100%',
      height: '100vh',
      position: 'relative',
      backgroundImage: 'url(/kayit/Arkaplan.png)',
      backgroundSize: 'cover',
      backgroundPosition: 'center',
      backgroundRepeat: 'no-repeat',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      flexDirection: 'column',
      fontFamily: 'Arial, sans-serif',
    },
    headerImage: {
      height: 'auto',
      marginBottom: 20,
      opacity: 0,
      animation: 'fadeIn 1s forwards',
    },
    languageContainer: {
      width: '80%',
      padding: 20,
      borderRadius: 10,
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      gap: 16,
      opacity: 0,
      animation: 'fadeIn 1s forwards',
    },
    languageButton: {
      width: 200,
      height: 45,
      background: 'rgba(255, 255, 255, 0.90)',
      borderRadius: 12,
      overflow: 'hidden',
      justifyContent: 'center',
      alignItems: 'center',
      display: 'flex',
      border: 'none',
      cursor: 'pointer',
      transition: 'background 0.3s, box-shadow 0.3s',
      boxShadow: '0 8px 12px rgba(0, 0, 0, 0.2)',
    },
    languageText: {
      color: 'rgba(0, 0, 0, 0.95)',
      fontSize: 20,
      fontWeight: '400',
    },
    currentLanguage: {
      marginTop: 20,
      fontSize: 24,
      fontWeight: 'bold',
      color: 'white',
      animation: 'fadeIn 0.3s forwards',
    },
  };

  useEffect(() => {
    const styleSheet = document.createElement('style');
    styleSheet.type = 'text/css';
    styleSheet.innerText = `
      @keyframes fadeIn {
        0% { opacity: 0; }
        100% { opacity: 1; }
      }
      .languageButton {
        transition: background 0.3s, box-shadow 0.3s;
        box-shadow: 0 8px 12px rgba(0, 0, 0, 0.2);
      }
      .languageButton:hover {
        background: white;
        box-shadow: 0 12px 24px rgba(0, 0, 0, 0.3);
      }
    `;
    document.head.appendChild(styleSheet);
  }, []);

  return (
    <div style={styles.container}>
      <img src="/ton-mini-app/Frame1261153050-2.png" alt="Header" style={styles.headerImage} />
      <div style={styles.languageContainer}>
        <button className="languageButton" style={styles.languageButton} onClick={() => handleLanguageSelect('Türkçe')}>
          <span style={styles.languageText}>Türkçe</span>
        </button>
        <button className="languageButton" style={styles.languageButton} onClick={() => handleLanguageSelect('English')}>
          <span style={styles.languageText}>English</span>
        </button>
        <button className="languageButton" style={styles.languageButton} onClick={() => handleLanguageSelect('فارسي')}>
          <span style={styles.languageText}>فارسي</span>
        </button>
        <button className="languageButton" style={styles.languageButton} onClick={() => handleLanguageSelect('Français')}>
          <span style={styles.languageText}>Français</span>
        </button>
        <button className="languageButton" style={styles.languageButton} onClick={() => handleLanguageSelect('русский')}>
          <span style={styles.languageText}>русский</span>
        </button>
      </div>
      <div style={styles.currentLanguage}>{currentLanguage}</div>
    </div>
  );
};

export default Kayit;
